INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Renewable Energy ', N'energy; biomass', N'An energy resource that can be replaced as it is used. Examples include: solar, wind, geothermal, hydro, and biomass', 15, N'http://macd.org/assets/downloads/envirothon/Biofuel_Student_Glossary.pdf', NULL, NULL, NULL, NULL, NULL, N'0e6d4f11-ec25-47c4-af64-659f65e08b0f')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Biochemical Conversion', N'Conversion; biofuel', N'The use of biological processes, usually microorganisms or enzymes, to convert organic materials into usable products such as biofuels', 27, N'http://www.aig.com/ncglobalweb/internet/US/en/files/Chartis_BiofuelsGlossary_tcm295-179858.pdf', NULL, NULL, NULL, NULL, NULL, N'600347c0-2c16-440d-b6f8-6a6d6ffec455')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Forestry', N'crop; biofuel;', N'Generally, a profession embracing the science, business, and art of creating, conserving, and managing forest, and forest lands for the continuing use of their resources, materials, and other forest products.', 18, N'http://agclass.nal.usda.gov/mtwdk.exe?k=ForestEng&l=60&w=336&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'20eae37d-1683-4fa8-af02-6fb1c0714cc0')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Energy Crop', N'biofuel; biomass; cellulose', N'Crops grown specifically to provide the raw materials for energy production, including food crops such as corn and sugarcane and nonfood crops such as poplar trees and switchgrass.', 41, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=3022&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'83354fd2-bb68-48a6-aaa6-76a7872722bc')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Cellulose', N'Bioenergy', N'A principle component of wood; it is made of linked glucose (sugar) molecules that strengthens the cell walls of most plants', 14, N'http://macd.org/assets/downloads/envirothon/Biofuel_Student_Glossary.pdf', NULL, NULL, NULL, NULL, NULL, N'7077c39d-a621-4db3-ae15-7aada5cbcd35')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'hhhh', N'TBI', N'TBI', 6, N'TBI', NULL, NULL, NULL, NULL, NULL, N'69569ce3-9b16-4c47-9c94-7ad2feb0761d')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Sorghum ', N'crop; cellulose; biomhighs', N'Sorghum is a grass that functions as a grain, forage, or sugar crop. It is a high-energy plant that is valued for biofuel production because of its adaptability and high yields. ', 18, N'http://sorghumgrowers.com/sorghum-101/', NULL, NULL, NULL, NULL, NULL, N'df5025c2-f02f-471b-91be-7dfbf5f80f3e')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Supply Chain', N'productivity; cost;', N'The network of firms that bring products to market, from companies that produce raw materials to retailers and others that deliver finished products to consumers. Economic value is added through the coordinated management of the flow of physical goods and associated information at each stage of the chain.', 14, N'http://agclass.nal.usda.gov/mtwdk.exe?s=1&n=1&y=0&l=60&k=glossary&t=2&w=supply+chain', NULL, NULL, NULL, NULL, NULL, N'f7c3413a-a0a9-4bc8-a26d-80c857ff3af0')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Biosystems Engineering', N'Biochemical conversion; engineering; biofuel;', N'The analysis, design, and control of biologically-based systems for the sustainable production and processing of food and biological materials and the efficient utilization of natural and renewable resources in order to enhance human health in harmony with the environment', 14, N'http://www.egr.msu.edu/~alocilja/Teaching/Principles%20of%20BE%20Book%208-12-2013.pdf', NULL, NULL, NULL, NULL, NULL, N'1fea8380-f5d6-4d13-9f8f-86c5ace494b1')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Poplar', N'crop; cellulose; biomass', N'Deciduous hardwood species of trees that is used in biofuel production as well as for wood, veneer, and environmental benefits. Poplars are harvested for bioenergy because the of the ability of the species to grow quickly, to produce a high amount of biomass in a short period of time, and to easily grow in various regions. Popular poplar trees used in biofuel production include: cottonwoods and hybrid poplars', 20, N'http://www.extension.org/pages/70456/poplar-populus-spp-trees-for-biofuel-production#.VIpIwIe3I40', NULL, NULL, NULL, NULL, NULL, N'af609a01-2f6b-4dbf-8e81-86dd6a8dd3a9')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Costs of Production', N'Cost; Bioenergy; Biomass', N'A cost incurred by a business when manufacturing a good or producing a service. Production costs combine raw material and labor. To figure out the cost of production per unit, the cost of production is divided by the number of units produce. ', 24, N'http://www.investopedia.com/terms/p/production-cost.asp', NULL, NULL, NULL, NULL, NULL, N'02bc9768-ff64-4848-9ec1-87a0071c1257')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'contract', N'TBI', N'TBI', 13, N'TBI', NULL, NULL, NULL, NULL, NULL, N'3a62c969-db82-4b93-8e49-88b1be0a519e')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Fiber', N'crop; biomass; cellulose', N'Fibers are long cells with thick walls and tapering ends. The cell wall often contain lignin and cellulose. They are dead at maturity and function as support tissue in plant stems and roots. They come from the outer portion of the stem of fibrous plants such as flax, hemp, and jute, or from the leaves of plants such as cattail, agave, and yucca. Fibers can be spun into filaments, thread, or rope; be chemically modified to create a composite material (e.g., rayon or cellophane); or matted into sheets as with paper. ', 13, N'http://www.fs.fed.us/wildflowers/ethnobotany/fibers.shtml', NULL, NULL, NULL, NULL, NULL, N'2b8affea-bde8-468a-b6cb-893ffbb6ff29')
