INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Feedstock', N'Crop; biomass; miscanthus; cottonwood; poplar; switchgrass; residue; eucalyptus;', N'Any raw materials (biomass or plant material) used to produce fuel. ', 14, N'http://www.altranex.com/glossary/', NULL, NULL, NULL, NULL, NULL, N'a0494807-240b-4b1c-a424-91ff6785b82b')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Short Rotation Woody Crops', N'crops; biomass', N'Woody crops such as willows, poplars, Robinia and Eucalyptus with coppicing abilities as well as lignocellulosic (biomass composed primarily of cellulose, hemicelluloses and lignin) crops such as reed canary grass, Miscanthus and switch grass. Coppicing means that the crops are fast growing and can be cut down to a low stump (or stool) when they are dormantin winter andgo on to produce many new stems in the following growing season. ', 18, N' http://www.okepscor.org/glossary-bioenergy-terms/glossary-bioenergy-terms & http://www.biomassenergycentre.org.uk/portal/page?_pageid=75,18092&_dad=portal&_schema=PORTAL & http://www.ieabioenergytask43.org/Task_30_Web_Site/index.htm', NULL, NULL, NULL, NULL, NULL, N'695a2acb-2a90-471e-99ca-9369a29628f1')
