INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Yield', N'crop; productivity;', N'The amount of a crop produced in a given time or from a given place. The amount of product output recovered from a quantity of raw material input in forest product industries. Also, the estimate in forest mensuration of the amount of wood that may be harvested from a particular type of forest stand by species, site, stocking, and management regime at various ages.', 27, N'http://www2.kenyon.edu/projects/farmschool/addins/glossary.htm & http://agclass.nal.usda.gov/mtwdk.exe?k=ForestEng&l=60&w=958&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'd8355c46-4ce6-4017-9ce7-c44239d14361')
