INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Ethanol', N'fuel; fossil fuel; energy;', N'Clean renewable fuel made from grain or other biomass sources and used to describe biologically processed ethyl alcohol that has been combined with a type of denaturant (to render undrinkable). Primarily used in vehicles as fuel or fuel additive', 13, N'http://www.aig.com/ncglobalweb/internet/US/en/files/Chartis_BiofuelsGlossary_tcm295-179858.pdf', NULL, NULL, NULL, NULL, NULL, N'55101f77-7ee1-45e6-89bb-e5386a2634e9')
INSERT [dbo].[GlossaryEntity] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Cottonwood', N'Biomass; biofuel; crop', N'A poplar hardwood tree species that is used for the research and production of biofuels. It is prized for its fast-growing and high production of biomass. Common cottonwoods used for biofuel include the black cottonwood and the Eastern cottonwood. ', 16, N'http://hardwoodbiofuels.org/wp-content/uploads/2014/02/PoplarforBiofuelsInfosheet.pdf', NULL, NULL, NULL, NULL, NULL, N'27a4fcd7-8196-4597-bf36-ec527d01b2a4')
