INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Miscanthus', N'crop; cellulose; biomass', N'Miscanthus (commonly known as Elephant Grass) is a high yielding energy crop that grows over 3 metres tall, resembles bamboo and produces a crop every year without the need for replanting. The rapid growth, low mineral content, and high biomass yield of Miscanthus increasingly make it a favourite choice as a biofuel,outperforming maize (corn) and other alternatives', 31, N'http://www.recrops.com/miscanthus', NULL, NULL, NULL, NULL, NULL, N'0f8f35eb-af92-48b7-bdad-5dc3924e973c')
