INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Renewable Energy ', N'energy; biomass', N'An energy resource that can be replaced as it is used. Examples include: solar, wind, geothermal, hydro, and biomass', 15, N'http://macd.org/assets/downloads/envirothon/Biofuel_Student_Glossary.pdf', NULL, NULL, NULL, NULL, NULL, N'0e6d4f11-ec25-47c4-af64-659f65e08b0f')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Biochemical Conversion', N'Conversion; biofuel', N'The use of biological processes, usually microorganisms or enzymes, to convert organic materials into usable products such as biofuels', 27, N'http://www.aig.com/ncglobalweb/internet/US/en/files/Chartis_BiofuelsGlossary_tcm295-179858.pdf', NULL, NULL, NULL, NULL, NULL, N'600347c0-2c16-440d-b6f8-6a6d6ffec455')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Forestry', N'crop; biofuel;', N'Generally, a profession embracing the science, business, and art of creating, conserving, and managing forest, and forest lands for the continuing use of their resources, materials, and other forest products.', 18, N'http://agclass.nal.usda.gov/mtwdk.exe?k=ForestEng&l=60&w=336&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'20eae37d-1683-4fa8-af02-6fb1c0714cc0')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Energy Crop', N'biofuel; biomass; cellulose', N'Crops grown specifically to provide the raw materials for energy production, including food crops such as corn and sugarcane and nonfood crops such as poplar trees and switchgrass.', 41, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=3022&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'83354fd2-bb68-48a6-aaa6-76a7872722bc')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Cellulose', N'Bioenergy', N'A principle component of wood; it is made of linked glucose (sugar) molecules that strengthens the cell walls of most plants', 14, N'http://macd.org/assets/downloads/envirothon/Biofuel_Student_Glossary.pdf', NULL, NULL, NULL, NULL, NULL, N'7077c39d-a621-4db3-ae15-7aada5cbcd35')
