INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Sorghum ', N'crop; cellulose; biomhighs', N'Sorghum is a grass that functions as a grain, forage, or sugar crop. It is a high-energy plant that is valued for biofuel production because of its adaptability and high yields. ', 18, N'http://sorghumgrowers.com/sorghum-101/', NULL, NULL, NULL, NULL, NULL, N'df5025c2-f02f-471b-91be-7dfbf5f80f3e')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Supply Chain', N'productivity; cost;', N'The network of firms that bring products to market, from companies that produce raw materials to retailers and others that deliver finished products to consumers. Economic value is added through the coordinated management of the flow of physical goods and associated information at each stage of the chain.', 14, N'http://agclass.nal.usda.gov/mtwdk.exe?s=1&n=1&y=0&l=60&k=glossary&t=2&w=supply+chain', NULL, NULL, NULL, NULL, NULL, N'f7c3413a-a0a9-4bc8-a26d-80c857ff3af0')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Biosystems Engineering', N'Biochemical conversion; engineering; biofuel;', N'The analysis, design, and control of biologically-based systems for the sustainable production and processing of food and biological materials and the efficient utilization of natural and renewable resources in order to enhance human health in harmony with the environment', 14, N'http://www.egr.msu.edu/~alocilja/Teaching/Principles%20of%20BE%20Book%208-12-2013.pdf', NULL, NULL, NULL, NULL, NULL, N'1fea8380-f5d6-4d13-9f8f-86c5ace494b1')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Poplar', N'crop; cellulose; biomass', N'Deciduous hardwood species of trees that is used in biofuel production as well as for wood, veneer, and environmental benefits. Poplars are harvested for bioenergy because the of the ability of the species to grow quickly, to produce a high amount of biomass in a short period of time, and to easily grow in various regions. Popular poplar trees used in biofuel production include: cottonwoods and hybrid poplars', 20, N'http://www.extension.org/pages/70456/poplar-populus-spp-trees-for-biofuel-production#.VIpIwIe3I40', NULL, NULL, NULL, NULL, NULL, N'af609a01-2f6b-4dbf-8e81-86dd6a8dd3a9')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Costs of Production', N'Cost; Bioenergy; Biomass', N'A cost incurred by a business when manufacturing a good or producing a service. Production costs combine raw material and labor. To figure out the cost of production per unit, the cost of production is divided by the number of units produce. ', 24, N'http://www.investopedia.com/terms/p/production-cost.asp', NULL, NULL, NULL, NULL, NULL, N'02bc9768-ff64-4848-9ec1-87a0071c1257')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'contract', N'TBI', N'TBI', 13, N'TBI', NULL, NULL, NULL, NULL, NULL, N'3a62c969-db82-4b93-8e49-88b1be0a519e')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Fiber', N'crop; biomass; cellulose', N'Fibers are long cells with thick walls and tapering ends. The cell wall often contain lignin and cellulose. They are dead at maturity and function as support tissue in plant stems and roots. They come from the outer portion of the stem of fibrous plants such as flax, hemp, and jute, or from the leaves of plants such as cattail, agave, and yucca. Fibers can be spun into filaments, thread, or rope; be chemically modified to create a composite material (e.g., rayon or cellophane); or matted into sheets as with paper. ', 13, N'http://www.fs.fed.us/wildflowers/ethnobotany/fibers.shtml', NULL, NULL, NULL, NULL, NULL, N'2b8affea-bde8-468a-b6cb-893ffbb6ff29')
