INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Bioproducts', N'energy; biomass', N'Bioproducts are fuels, chemicals, materials, or electric power or heat produced from biomass. Including any energy, commercial or industrial product (other than food or feed) that utilizes biological products or renewable domestic agricultural (plant, animal, and marine) or forestry materials.', 20, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=994&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'e93fcfd7-185c-41a0-8324-9073a79ff928')
