INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Return On Investment', N'productivity; cost', N'ROI is a performance measure used to evaluate the efficiency of an investment. To calculate the
benefit (return) of an investment is divided by the cost of the investment; the result is expressed as a
percentage or a ratio. ROI = (gain from investment  cost of investment)/cost of investment', 15, N'http://blogs.extension.org/bioen1/files/2009/11/BIOENglossaryFINALv1.pdf', NULL, NULL, NULL, NULL, NULL, N'd1e50d12-b1f4-43f3-8b74-a36f30656876')
