INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Natural Resource', N'forestry;', N'Useful raw materials that we get from the Earth. They occur naturally, which means that humans cannot make natural resources. Instead, we use and modify natural resources in ways that are beneficial to us. Examples: air, water, sunlight, plants, and animals. ', 22, N'http://education-portal.com/academy/lesson/what-are-natural-resources-definition-lesson-quiz.html', NULL, NULL, NULL, NULL, NULL, N'595a54f0-a245-4bde-ae74-b6645000f7b2')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Alternative Fuels', N'Biofuel; Fuel; Fossil Fuel', N'Fuels that do not involve fossil fuels. Examples: solar power, wind power, and biomass.', 33, N'http://bioenergy-midlands.org/why-bioenergy/glossary-of-bioenergy-terms/', N'1afe36fa-e1f3-406b-9c73-914ec23ec2be', NULL, NULL, CAST(N'2015-04-19 18:00:21.047' AS DateTime), NULL, N'0110b9e0-943f-4bd2-a517-b67bbe267345')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Watershed', N'crop; cellulose; biomlands', N'The land area that drains water to a particular stream, river, or lake. It is a land feature that can be identified by tracing a line along the highest elevations between two areas on a map, often a ridge.', 21, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=9287&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'84e10cb9-6de6-4e8c-b92e-ba80d48865c3')
