INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Herbaceous', N'cellulose; crop', N'Refers to a plant that has a non-woody stem and which dies back at the end of the growing season', 17, N'http://www.biology-online.org/dictionary/Herbaceous', NULL, NULL, NULL, NULL, NULL, N'57ccc405-6433-47e1-bd4d-be740a6a853c')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Yield', N'crop; productivity;', N'The amount of a crop produced in a given time or from a given place. The amount of product output recovered from a quantity of raw material input in forest product industries. Also, the estimate in forest mensuration of the amount of wood that may be harvested from a particular type of forest stand by species, site, stocking, and management regime at various ages.', 27, N'http://www2.kenyon.edu/projects/farmschool/addins/glossary.htm & http://agclass.nal.usda.gov/mtwdk.exe?k=ForestEng&l=60&w=958&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'd8355c46-4ce6-4017-9ce7-c44239d14361')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Conservation', N'natural resources;', N'The protection, preservation, or restoration of natural resources such as forests, soil, water and wildlife', 19, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=6179&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'75c9a198-8277-4c20-b6cd-cc3696ca73b8')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Softwood', N'crop; cellulose; biomass', N'Botanical grouping of trees that are usually evergreen and have needlelike or scalelike leaves. Also known as conifers and coniferous trees. Also the wood produced from such trees. The term softwood does not refer to the hardness of the wood.', 13, N'http://agclass.nal.usda.gov/mtwdk.exe?k=ForestEng&l=60&w=814&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'266d41e2-793b-400a-9b35-cd5c9930b5a7')
