INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Biomass', N'forest; residues; ', N'The total amount of organic matter present in an organism, population, ecosystem or given area', 81, N'http://agclass.nal.usda.gov/mtwdk.exe?k=glossary&l=60&w=1096&n=1&s=5&t=2', NULL, NULL, NULL, NULL, NULL, N'364a0e43-432b-4e5e-9385-d97c39ad5d0e')
