INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'NPV', N'NPV; Net Present Worth, ', N'The net present value (NPV) or net present worth (NPW) is defined as the sum of the present values (PVs) of incoming and outgoing cash flows over a period of time. Incoming and outgoing cash flows can also be described as benefit and cost cash flows, respectivelyely.', 71, N'https://en.wikipedia.org/wiki/Net_present_value', NULL, NULL, NULL, NULL, NULL, N'1296c946-be1d-4a4b-86ee-f103c214b60f')
INSERT [dbo].[GlossaryEntities] ([term], [keywords], [description], [counter], [source], [ModifiedBy], [CreatedBy], [Created], [Modified], [IsDirty], [Id]) VALUES (N'Switchgrass', N'crop; cellulose; biomass', N'A North American native perennial warm-season grass which is used to develop biofuels because of its high yield and ability to easily grow from the seed with little agricultural help. ', 14, N'http://www.extension.org/pages/26635/switchgrass-panicum-virgatum-for-biofuel-production#.VIpWlYe3I40', NULL, NULL, NULL, NULL, NULL, N'd8f143cc-dd4f-4479-a37a-f54a9e2b70ba')
